import React from "react";
import { Link } from "react-router-dom";
import "./a";

function HomePage() {
  // ...use homepage code from previous answer, but with these buttons:
  return (
    <div className="container">
      <header className="navbar">
        <div className="navbar-brand">Snake Rescue Team</div>
        <div className="navbar-actions">
          <Link to="/login"><button className="login-btn">Login</button></Link>
          <Link to="/signup"><button className="getstarted-btn">Get Started</button></Link>
        </div>
      </header>
      {/* ...rest of homepage remains same... */}
    </div>
  );
}
export default HomePage;
